                <div className="container">
                    <div className="row align-items-center">
                        <div className="col-md-8">
                            <div className="h_promo_content">
                                
                            </div>
                        </div>
                        <div className="col-md-4 text-right">
                           
                        </div>
                    </div>
                </div>
            </section>
        )
    }
}
export default HostingActionTwo;
